import React from 'react'
import './Dashboard.scss'
import NavBar from '../../component/NavBar/NavBar'
// Import TraderList component below
import TraderList, {onTraderDelete} from '../../component/TraderList/TraderList'

function Dashboard(props) {
    const onTraderDelete = (id) => {
   //delete trader logic
   console.log("Trader " + id + " is deleted.");}
  return (
    <div className="dashboard">
        <h2>Dashboard</h2>
        <NavBar />
        <div className="dashboard-content">
            <TraderList onTraderDeleteClick={onTraderDelete} />
        </div>
    </div>
  )
}

export default Dashboard
